import React, {useState} from 'react';

import TitleScreen from './TitleScreen.js';

function FlashMath(){
    const [rem, setRem] = useState(0);

    let rems = [<TitleScreen changeRem={(newRem) => setRem(newRem)}/>, <div></div>];

    return (
        <>
            {rems[rem]}
        </>
    )
}

export default FlashMath;
